Los tipos clasifican los objetos, pero en esta versión son solo un nombre.
{ la eliminación de tipos de momento no se considera en una primera versión }
No se puede quitar un tipo que esté definido en algún objeto.

Las etiquetas clasifican los objetos. Normalmente se crean las etiquetas desde el mismo objeto, pero aquí está la lista global de etiquetas.
{ la eliminación de eituetas de momento no se considera en una primera versión }
No se puede quitar una etiqueta referenciada en algún objeto.
